package com.suresh.datastructers.recursion;

import java.math.BigInteger;

/**
 * @author syerrarapu
 *
 */
public class SuperDigit {

  static int superDigit(String n, int k) {

    int sum = 0;
    for (int i = 0; i < n.length(); i++) {
      sum += Character.getNumericValue(n.charAt(i));
    }
    return computeSuperDigitHelper("" + sum * k);

  }

  /**
   * @param sb
   */
  private static int computeSuperDigitHelper(String sb) {
    if (sb.length() <= 1) {
      return Integer.parseInt(sb.toString());
    }

    int sum = 0;
    for (int i = 0; i < sb.length(); i++) {
      sum += Character.getNumericValue(sb.charAt(i));
    }

    return computeSuperDigitHelper("" + sum);

  }

  public static void main(String[] args) {
    System.out.println(superDigit("    100000", 3));

  }

}
